var asn1 = require('@panva/asn1.js');

var types = new Map();
var AlgorithmIdentifier = asn1.define('AlgorithmIdentifier', require('./algorithm_identifier'));
types.set('AlgorithmIdentifier', AlgorithmIdentifier);
var ECPrivateKey = asn1.define('ECPrivateKey', require('./ec_private_key'));
types.set('ECPrivateKey', ECPrivateKey);
var PrivateKeyInfo = asn1.define('PrivateKeyInfo', require('./private_key_info')(AlgorithmIdentifier));
types.set('PrivateKeyInfo', PrivateKeyInfo);
var PublicKeyInfo = asn1.define('PublicKeyInfo', require('./public_key_info')(AlgorithmIdentifier));
types.set('PublicKeyInfo', PublicKeyInfo);
var PrivateKey = asn1.define('PrivateKey', require('./private_key'));
types.set('PrivateKey', PrivateKey);
var OneAsymmetricKey = asn1.define('OneAsymmetricKey', require('./one_asymmetric_key')(AlgorithmIdentifier, PrivateKey));
types.set('OneAsymmetricKey', OneAsymmetricKey);
var RSAPrivateKey = asn1.define('RSAPrivateKey', require('./rsa_private_key'));
types.set('RSAPrivateKey', RSAPrivateKey);
var RSAPublicKey = asn1.define('RSAPublicKey', require('./rsa_public_key'));
types.set('RSAPublicKey', RSAPublicKey);
module.exports = types;
